import React from "react";
import "./card.css";

function Card() {
  const imgstart = true;
  return (
    <>
      <div className="card ">
        <div className="card-image-container">
          <img src="images/WallpaperStudio.jpg" alt="image" />
        </div>
        <div className="card-text-container">
          <div className="card-heading">
            <h1>Credit card website</h1>
          </div>
          <div className="card-description">
            <p>
              Lorem ipsum, dolor sit amet consectetur adipisicing elit. Sint
              accusantium, at nisi alias, cumque perferendis autem ex, tempora
              minus architecto obcaecati. Ipsum provident mollitia molestiae ea
              vitae cupiditate dolorem aliquam!
            </p>
          </div>
        </div>
      </div>
    </>
  );
}

export default Card;
